import React from "react";
import Header from "./components/header/Header";
import GetStarted from "./components/content/GetStarted";
import Marketplace from "./components/content/Marketplace";
import Page1 from "./components/content/page1";
import Page2 from "./components/content/page2";

import './App.css';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter> 
        <body>
          <Header />
          <Routes>
            <Route exact path='/' element={<GetStarted/>} />
            <Route exact path='/marketplace' element={<Page1/>} />
            <Route exact path='/page1' element={<Page1/>} />
            <Route exact path='/page2' element={<Page2/>} />
          </Routes>
        </body>
      </BrowserRouter>
    </div>
  );
}

export default App;
